@lattner @jckarter

In 0bfacde2, the parsing was changed so that this expression became a valid prefix operator `.` preceding an identifier. The test was intended to check that identifiers can't start with combining chars, so this diff removes the `.` and leaves only the combining `` preceding the letters. Before it is whitespace.

(Note: some browsers don't display this properly  you can copy/paste the line into the Character Palette to see the order in which the characters appear in the source.)
